notes:
Bevolking, huishoudens en bevolkingsontwikkeling in Nederlandse gemeenten met 100 duizend of meer inwoners.

De volgende uitsplitsingen zijn mogelijk:
- Bevolking op 1 januari naar herkomstgroepering, leeftijd, geslacht en gemeente;
- Particuliere huishoudens op 1 januari naar leeftijd, geslacht en gemeente;
- Levendgeborenen naar herkomstgroepering van het kind, leeftijd van de moeder, geslacht en gemeente;
- Overledenen naar leeftijd, geslacht en gemeente;
- Binnen gemeenten verhuisde personen naar leeftijd, geslacht en gemeente;
- Tussen gemeenten verhuisde personen naar leeftijd, geslacht en gemeente;
- Immi en emigratie naar leeftijd, geslacht en gemeente;
- Bevolkingsgroei naar leeftijd, geslacht en gemeente;
- Bevolking op 31 december naar leeftijd, geslacht en gemeente.

Gegevens beschikbaar vanaf: 2000

Status van de cijfers:
Alle in de tabel opgenomen cijfers zijn definitief.
De manier waarop de cijfers over de bevolkingsontwikkeling worden geproduceerd is in 2014 gewijzigd. Dit heeft tot gevolg dat de cijfers van geboorte, sterfte en migratie over 2013 in verschillende tabellen soms niet overeenkomen. De verschillen zijn minimaal en treden alleen op in 2013.

Wijzigingen per 12 december 2014:
De cijfers van de bevolkingsontwikkeling over 2013 zijn toegevoegd;
De cijfers omtrent bevolkingsomvang en huishoudens per 1 januari 2014 zijn toegevoegd;
Per 1 juli 2013 is Kroatië aan de Europese Unie toegevoegd;
Per 1 januari 2014 zijn de gemeenten Alphen a/d Rijn, Delft en Leeuwarden toegevoegd. 

Wanneer komen er nieuwe cijfers?
In het vierde kwartaal van 2015 worden de cijfers over 2014 omtrent de bevolkingsontwikkeling
aan de tabel toegevoegd. Gelijktijdig worden de cijfers van de bevolkingsomvang en de huishoudens per 1 januari 2015 opgenomen.
